import { useState } from "react";
import Box from '@mui/material/Box';
import {TextField, Button, Stack} from '@mui/material';

export default function Registration(){
    return <Stack spacing={2} direction="column">
    <TextField required id="outlined-required" label="Name"/>
    <TextField required id="outlined-required" label="E-Mail" type="email"/>
    <TextField id="outlined-password-input" label="Password" type="password" autoComplete="current-password"/>
    <Button variant="contained" size="small" >Register</Button>
  </Stack>
}
